import React, { Component } from 'react';
import './App.css';

import Jumbotron from './component/jumbotron';
import TabBar from './component/tabBar';
import Footer from './component/footer';

class App extends Component {


  render() {
    return (
      <div className="App">
        <Jumbotron />
          <TabBar />
            <br />
            <br />
            <Footer>
              <Footer />
            </Footer>
      </div>
    )
  }
}

export default App;
